import React from "react";
import video0 from "../assets/Images/video-list-0.jpg";

export default function video(props) {
  return (
    <div className="video">
      <video
        className="video__playing"
        poster={`${props.mainVideo.video}`}
        controls
      ></video>
    </div>
  );
}
